import React, { useState } from "react";
import NewExercise from "./NewExercise";
import AddIcon from '@mui/icons-material/Add';

export default function AddWorkout() {

    const initialState = {
        name: '',
        exercises: [<NewExercise key={0}/>, <NewExercise key={1}/>]
    }

    const [key, setKey] = useState(1)
    const [exerciseList, setExerciseList] = useState(initialState)
    // state here that is an array of objects
    // Not just an array of objects, though, but also have a name property
    // objects have a name (exercise), setCount, and repRange
    
    console.log({...exerciseList})

    function addExercise() {
        setKey(key => key + 1)
        setExerciseList([...exerciseList, <NewExercise key={key}/>])
    }

    function submitWorkout() {
        fetch('/api/workouts/add-workout', {
            method: 'POST'
        })
            .then(res => res.json())
            .then(data => console.log(data))
    }

    return (
        <>
            <input placeholder='Enter workout name'></input>
            <table className='exercise-table'>
                <tbody>
                    <tr>
                        <th>Exercise</th>
                        <th># of Sets</th>
                        <th>Rep Range</th>
                    </tr>
                    {exerciseList}
                </tbody>
            </table>
            <AddIcon onClick={addExercise} />
            <button onClick={submitWorkout}>Submit Workout</button>
        </>
    )
}
